ads.description:
Witam.



Oferuję na sprzedaż samochód idealny do miasta jakim jest mikrovan Opel Agila z silnikiem 1.2 Twinport o mocy 80 KM z rozrządem na łańcuchu.

Samochód pomimo niewielkich rozmiarów zewnętrznych oferuje przestronne wnętrze, w którym wygodnie mogą podróżować 4 osoby.

Agila od 2006 r. przejechała 131 tyś. kilometrów i jest zachowana w dobrym stanie technicznym i blacharskim. Nadwozie, w bardzo ładnym kolorze, nosi ślady używania w warunkach miejskich tj. niewielkie obcierki, lekkie wgniecenia na tylnych prawych i przednich lewych drzwiach. Nie posiada śladów rdzy.

Wnętrze pojazdu ładnie utrzymane, jasne obicia foteli i boczków drzwi.



Samochód wyposażony jest w:



• klimatyzację manualną (sprawną, po serwisie polegającym na sprawdzeniu szczelności, uzupełnieniu czynnika, wymianie filtra kabinowego, ozonowanie wnętrza);

• webasto ogrzewanie postojowe;

• elektrycznie sterowane szyby przednie;

• wspomaganie kierownicy;

• przednie halogeny przeciwmgielne;

• oryginalny radioodbiornik z odtwarzaczem CD.



Samochód sprowadzony z RFN, zarejestrowany i ubezpieczony, z ważnym OC. Gotowy do jazdy. Idealny samochód dla początkującego kierowcy. Pudełkowaty kształt, niewielkie wymiary zewnętrzne, doskonała widoczność we wszystkich kierunkach ułatwiają manewrowanie na parkingach, wąskich ulicach itp.

Dzień dobrym, mam do sprzedania samochód osobowy marki Alfa Romeo 147 wyprodukowany w 2004 roku, który został wyposażony w silnik benzynowy o pojemności 1598 cm3, legitymujący się mocą 105 KM, który pokonał do tej pory 230000 km. Samochód pod względem mechanicznym w bardzo dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Alfa prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Alfa jest wyposażenia w:

- Klimatyzacje automatyczna;

- Elektryczne szyby przednie;

- Tempomat;

- ABS;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 21.11.2025 roku.

Przegląd techniczny 27.09.2025 roku.
